import classes from "./MainHeader.module.css";
import Button from "../../UI/Button/Button";
import reactRouterDom from "react-router-dom";

const MainHeader = () => {

const myst ={
  textdecoration: "none"
}

  return (


    <header className={classes.header}>
      <nav>
        <ul>
          <Button>
            <a href="/Detail">Menu</a>
          </Button>

          <h3>
            <NavLink ClassName={classes.active} style={myst} to="/VList">
              Vendor List
            </NavLink>
          </h3>
          <h2>
            <NavLink activeClassName={classes.active} to="/VendorForm">
              Create Vendor
            </NavLink>
          </h2>
        </ul>
      </nav>
    </header>
  );
};

export default MainHeader;
